import React from "react";
import classes from '../styles/homePage.module.css'
import Images from  '../image/images.js'
// import backgroundImage from './image/image1.jpg'; 

import bluefinsLogo from '../image/bluefinsLogo.jpg'; 
import backgroundImage from '../image/image2.jpg'; 


function HomePage() {
    return (

        <div>
        <h1>Home Page</h1>
        <img src={bluefinsLogo} alt=''></img>
        <img src={backgroundImage} alt=''></img>
        <img src={Images.backgroundImage} alt='backgroundImage'></img>




        </div>

    );
}

export default HomePage;
